import React from "react";
import { BrowserRouter as Router, Route, Navigate, } from "react-router-dom";

import Users from './users/pages/Users';
import './App.css';
import Location from "./locations/pages/Location";

const App = () => {
  return (
    <Router>
        <Route path="/" exact>
          <Users />
        </Route>
        <Route path="/pages/new" exact>
          <Location />
        </Route>
      <Navigate to="/" />
    </Router>
  );
}

export default App;
